import './App.css';
import NavigationBar from './components/NavigationBar';
import Welcome from './components/Welcome';
import Footer from './components/Footer';

function App() {

  const marginTop = {
    marginTop: "2%"
  }

  return (
    <div>
      <NavigationBar />

      <div style={marginTop}>
        <Welcome/>
      </div>

      <Footer fixed="bottom"/>
    </div>
  );
}

export default App;
